import React ,{Component}from 'react';
import { Platform,Alert,Text, View, Image,SafeAreaView,ScrollView,TouchableOpacity,Modal,ActivityIndicator } from 'react-native';
import {styles} from '../providerStyle';
import DataContext from '../../providerContext';
import CalendarPicker from 'react-native-calendar-picker';
import moment from 'moment';
import I18n from '../switchLanguage';

export default class ProcessingOrder extends Component {
    constructor(props) {
      super(props);
      this.state={
        data:[],
        time:[],
        isEnabled: false,
        modalVisible: false,
        mdVisible:false,
        cardVisible:false,
        Visible:false,
        selectedId:'',
        selectedDoctor:'',
        timeLoad:false,
        isLoading:true,
        selectedDate: new Date(),
        mcrn:'',
        mmobile:'',
        mdate:'',
        mdoctor:'',
        mclass:'',
        maddress:'',
        mflag:1,
        minsurance:'',
        msnum:'',
        mcnum:'',
        medate:'',
      };
      this.onDateChange = this.onDateChange.bind(this);
    }

  /*
} */
  componentDidMount = () => {
    this._unsubscribe = this.props.navigation.addListener('focus', () => {this.query()});
  }
  componentWillUnmount() {
    this._unsubscribe();
  }

  setIsEnabled = (value) => {
    this.setState({isEnabled: value})
  }
  setModalVisible = (value) => {
    this.setState({modalVisible: value})
  }
  setMdVisible = (value) => {
    this.setState({mdVisible: value})
  }
  setVisible = (visible) => {
    this.setState({ Visible: visible });
  }
  formatDate(date) {
    var d = new Date(date),
        month = '' + (d.getMonth() + 1),
        day = '' + d.getDate(),
        year = d.getFullYear();

    if (month.length < 2)
        month = '0' + month;
    if (day.length < 2)
        day = '0' + day;

    return [year, month, day].join('-');
  }

  sendRequest(date){
    this.setState({timeLoad:true})
    let url = 'http://'
    +this.context.url
    +'/aicare-business-api/business/user/scheduledetail?date='
    + date +'&businessEmployerId=' + this.state.selectedDoctor + '&status=0';
      fetch(url,{
        method: 'GET',
        mode: 'cors',
        credentials: 'include',
        headers: {
        'Accept':       'application/json',
        'Content-Type': 'application/json',
        'sso-auth-token': this.context.token,
        'sso-refresh-token': this.context.refresh_token,
      }})
      .then((response) => response.json())
      .then((json) => {
        this.setState({timeLoad:false});
        if (json.code === 0) {
          console.log(json.msg);
          this.setState({time:json.data});
        } else {
          console.log(json.msg);
        }
      }).catch(error => console.warn(error));
  }

  modify(sid,stime,etime) {
    Alert.alert(
      '提醒',
      '您确定要修改预约至'+stime+' - ' +etime+'吗？',
      [
        {text: '确定', onPress: () => {
          this.setState({isLoading:true})
          let url = 'http://'
          +this.context.url
          +'/aicare-business-api/business/appointment/modify?'
          +'id=' + this.state.selectedId
          +'&scheduleDetailedId=' + sid;
            fetch(url,{
              method: 'POST',
              mode: 'cors',
              credentials: 'include',
              headers: {
              'Accept':       'application/json',
              'Content-Type': 'application/json',
              'sso-auth-token': this.context.token,
              'sso-refresh-token': this.context.refresh_token,
            }
            })
            .then((response) => response.json())
            .then((json) => {
              if (json.code === 0) {
                Alert.alert('修改成功')
              } else {
                Alert.alert(json.msg)
              }
              this.setMdVisible(false)
              this.query();
            }).catch(error => console.warn(error));
        }},
        {text: '取消', onPress: () => console.log('no button clicked'),style: "cancel"},
      ],
      {
        cancelable: false
      }
    );
}
  onDateChange(date) {
    let fd = this.formatDate(date);
    this.sendRequest(fd);
  }

  findvis(id) {
    for (let i=0;i<this.state.mds.length;i++) {
      if(this.state.mds[i].id == id) {
        return this.state.mds[i].visible;
      }
    }
  }

  queryDate = (date) =>{
    this.setState({
      modalVisible:false,
      isLoading:true,
      selectedDate: date,
    });
    let tp = 1;
    if (this.context.employerId !=null) {
      tp = 2;
    }
    let fd = this.formatDate(date);
      let url = 'http://'
      +this.context.url
      +'/aicare-business-api/business/appointment/query?status=3'
      + '&type=' + tp
      + '&appointDate=' + fd
      + '&dateFlg=0';
        fetch(url,{
          method: 'GET',
          mode: 'cors',
          credentials: 'include',
          headers: {
          'Accept':       'application/json',
          'Content-Type': 'application/json',
          'sso-auth-token': this.context.token,
          'sso-refresh-token': this.context.refresh_token,
        }})
        .then((response) => response.json())
        .then((json) => {
          this.setState({isLoading:false})
          if (json.code === 0) {
            console.log(json);
            this.setState({data:json.page});
            for(let i=0; i<json.page.length;i++){
              var d= {
                id:json.page[i].id,
                visible:false,
              }
              let t = this.state.mds;
              t.push(d);
              this.setState({mds:t});
            }
          } else if (json.code == 10011) {
            this.loggedin(json.msg)
          }else {
            console.log(json.msg)
          }
        }).catch(error => console.warn(error));
  }
  query() {
    this.setState({isLoading:true})
    let tp = 1;
    if (this.context.employerId !=null) {
      tp = 2;
    }
    let url = 'http://'
    +this.context.url
    +'/aicare-business-api/business/appointment/query?status=3'
    + '&type=' + tp;
      fetch(url,{
        method: 'GET',
        mode: 'cors',
        credentials: 'include',
        headers: {
        'Accept':       'application/json',
        'Content-Type': 'application/json',
        'sso-auth-token': this.context.token,
        'sso-refresh-token': this.context.refresh_token,
      }})
      .then((response) => response.json())
      .then((json) => {
        this.setState({isLoading:false})
        if (json.code === 0) {
          console.log(json);
          this.setState({data:json.page});
          for(let i=0; i<json.page.length;i++){
            var d= {
              id:json.page[i].id,
              visible:false,
            }
            let t = this.state.mds;
            t.push(d);
            this.setState({mds:t});
          }
        } else if (json.code == 10011) {
          this.loggedin(json.msg)
        } else {
          console.log(json.msg)
        }
      }).catch(error => console.warn(error));
  }
  queryType(type){
    this.setState({
      Visible:false,
      isLoading:true,
      selectedType:type,
    });
    let tp = 1;
    if (this.context.employerId !=null) {
      tp = 2;
    }
      let url = 'http://'
      +this.context.url
      +'/aicare-business-api/business/appointment/query?status=3'
      + '&type=' + tp
      + '&deptId=' + type
        fetch(url,{
          method: 'GET',
          mode: 'cors',
          credentials: 'include',
          headers: {
          'Accept':       'application/json',
          'Content-Type': 'application/json',
          'sso-auth-token': this.context.token,
          'sso-refresh-token': this.context.refresh_token,
        }})
        .then((response) => response.json())
        .then((json) => {
          this.setState({isLoading:false})
          if (json.code === 0) {
            console.log(json);
            this.setState({data:json.page});
            for(let i=0; i<json.page.length;i++){
              var d= {
                id:json.page[i].id,
                visible:false,
              }
              let t = this.state.mds;
              t.push(d);
              this.setState({mds:t});
            }
          } else if (json.code == 10011) {
            this.loggedin(json.msg)
          } else {
            console.log(json.msg)
          }
        }).catch(error => console.warn(error));
  }
  loggedin(msg) {
    Alert.alert(
      '',
      msg,
      [
        {text: '确定', onPress: () => {this.context.action.logout()}},
      ],
      {
        cancelable: false
      }
    );
  }
  render () {
    var date = new Date(this.state.selectedDate).getDate();
    var month = new Date(this.state.selectedDate).getMonth() + 1;
    let times=[];
    if (this.state.time.length >0) {
    times = this.state.time.map((item) => {
      return (
        <View style={{height:30,
        width:'auto',
        paddingLeft:15,
        paddingRight:15,
        marginTop:5,
        marginBottom:5,
        marginLeft: 10,
        marginRight: 10,
        borderRadius:10,
        backgroundColor:'#8FD7D3',
        alignItems: 'center',
        justifyContent: 'center'}} key={item.id}>
          <TouchableOpacity onPress={() => {this.modify(item.scheduleDetailedId,item.startTime.substring(0,5),item.endTime.substring(0,5));}}>
            <Text style={{color:'white'}}>{item.startTime.substring(0,5)}-{item.endTime.substring(0,5)}</Text>
          </TouchableOpacity>
        </View>
      )
    })}
    let orders;
    if (this.state.isLoading){
      return(
        <View style={{ flex: 1, backgroundColor:'rgb(51,51,51)', justifyContent: "center", alignItems: "center" }}>
          <ActivityIndicator size="large" color="white"  />
        </View>
    )
    }else {
    if (this.state.data.length > 0) {
    orders = this.state.data.map((item) => {
      let tp = '';
      if (item.videoChannel == 1) {
        tp = 'Facetime'
      } else {
        tp = 'Skype'
      }
      return (
        <View key={item.id} style={{borderTopWidth:1,flexDirection:'row',width:'90%',height:50,backgroundColor:'white'}}>
          <TouchableOpacity style={{flexDirection:'row',alignItems:'center',width:'14%',paddingLeft:'1%'}}
          onPress={()=>{
            this.setState({
              mcrn:item.customerRealName,
              mmobile:item.mobile,
              mdate:moment(item.appointDate).format('L').substring(0,5) +' '+ item.startTime&&item.startTime.substring(0,5) + '-' + item.endTime&&item.endTime.substring(0,5),
              mdoctor:item.businessEmployerName,
              mclass:item.serviceClassName,
              maddress:item.orgAddress,
              mflag:item.telehealthFlg,
              minsurance:item.insuranceType,
              msnum:item.serialNumber,
              mcnum:item.cardNumber,
              medate:item.expireDate,
            })
            this.setState({cardVisible:true})
          }}>
            {item.sex == 'Male'?
            <Image
